const TopBar = () => {
    return <div className="top-bar">
            <img className="top-bar-logo" src="https://yt3.ggpht.com/HmYB2gIFhaCnLRNA7EWk_qBWE7o7On594S5vsrXkHBRVppBn2u0pGVi0UoBW-keDBZ5NWs_PtQ=w640-fcrop64=1,32b75a57cd48a5a8-nd-c0xffffffff-rj-k-no" alt="logo"/>
    </div>
}

export default TopBar;
